import React from "react";
import "./list.css";
import Navbar from "../../components/navbar/Navbar";
import Header from "../../components/header/Header";

function List() {
  return (
    <div className="list">
      <Navbar />
      <Header type="list" />
      <div className="container box">
      
      </div>
    </div>
  );
}

export default List;
